Tested ACK d3073c232a7a0ad182cf4d9eb1495c79795669e9

@fanquake - there's been a lot of churn in the test directory recently, which is how some of these have crept in.

Longer term, I expect we'll continue to see unused imports until we have a sensible import scheme for the functional tests such as https://github.com/bitcoin/bitcoin/pull/9876#issuecomment-283198485. Static analysis tools can't work out wildcard imports and linters like flake8 throw up many errors when wildcards are used, so I expect no-one is using linters before committing.
